import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header  from './header';
import Input  from './input';
import typeemo  from './input';
import Emoji  from './emoji';

function App() {
  return (
    <div><Header/>
    <Input/>
    <typeemo/>
    <Emoji/>
    </div>

  );
}

export default App;
